import React, { Component } from 'react';


class Home extends Component {
	constructor(props) {
  		super(props);
  }

  render(){
		return (
      <div class="container">
        <h1>Welcome to Game Center!</h1>
				<br></br>
				<p>Game Center currently features the following games:</p>
				<h6>Memory Game:</h6>
				<p>This is a version of the classic memory game implemented in React.</p>
				<h5>Sudoku:</h5>
				<p>This is a Sudoku Puzzle Generator which generates Unique Random Sudoku Puzzles in real time.</p>
				<p>Sudoku Puzzle Solver:</p>
				<p>These are Sudoku Puzzle Solvers implemented using Recursive and non-Recursive Backtracking Algorithms.</p>
				<p>Features:</p>
				<p>All puzzles are implemented in React as frontend and Node, Express and MongoDB at the backend.</p>
				<p>Future Enhancements:</p>
				<p>** Use redux for State Management.</p>
				<p>** Implement Sudoku Solver using a Strategy Based Logical Solving Algorithm.</p>
      </div>
		)
	}
}

export default Home;
